// SPDX-License-Identifier: MIT
pragma solidity 0.8.10;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";


struct Server {
    address owner;
    string name;
    string ip;
    uint port;

    uint _time;
    uint _index;
}


contract PlayerAuth is ERC721 {
    uint _total;

    constructor() ERC721("Player Auth", "AUTH") {
    }


    function Register() external returns (uint) {
        require(balanceOf(msg.sender) == 0);
        _total += 1;
        _safeMint(msg.sender, _total);
        return _total;
    } 


    function _beforeTokenTransfer(
        address from,
        address, //to,
        uint256 //tokenId
    ) internal pure override {
        require(from == address(0));
    }
}


contract LobbyServer is ERC721 {
    uint _total;

    PlayerAuth _playerAuth;
    mapping(uint => Server) _servers;
    uint[] _serverIDs;

    constructor(PlayerAuth playerAuth) ERC721("Server", "SERVER") {
        _playerAuth = playerAuth;
    }

    modifier authed () {
        require(_playerAuth.balanceOf(msg.sender) == 1);
        _;
    }

    function RegisterServer(string memory name, string memory ip, uint port) external authed returns (uint) {
        require(balanceOf(msg.sender) == 0);

        uint id = ++_total;
        Server storage server = _servers[id];
        _serverIDs.push(id);
        _safeMint(msg.sender, id);

        server.owner = msg.sender;
        server.name = name;
        server.ip = ip;
        server.port = port;

        server._index = _serverIDs.length - 1;
        server._time = block.timestamp;

        return id;
    }


    function RemoveServer(uint id) external authed {
        require (balanceOf(msg.sender) == 0);
        require (ownerOf(id) == msg.sender);

        // Get the array index
        uint _index = _servers[id]._index;
        // Put the last element into that slot
        _serverIDs[_index] = _serverIDs[_serverIDs.length - 1];
        // Delete the last element
        _serverIDs.pop();

        // Update the array index of the serverid that got moved
        uint movedId = _serverIDs[_index];
        _servers[movedId]._index = _index;

        // Delete the actual server entry
        delete _servers[id];

        // Burn the server NFT
        _burn(id);
    }


    function KeepAlive(uint id) external authed {
        require (ownerOf(id) == msg.sender);
        _servers[id]._time = block.timestamp;
    }


    function ServerList() external view returns (uint[] memory) {
        return _serverIDs;
    }


    function GetServer(uint id) external view returns (Server memory) {
        return _servers[id];
    }
